&lt;p&gt;From &lt;br /&gt;
&lt;a href="http://en.wikipedia.org/wiki/Shibuya,_Tokyo" rel="nofollow"&gt;Wikipedia&lt;/a&gt;:&lt;br /&gt;
&lt;br /&gt;
&lt;i&gt;Shibuya is one of the 23 special wards of Tokyo, Japan. As of 2008, it had an estimated population of 208,371.&lt;br /&gt;
&lt;br /&gt;
Shibuya has achieved great popularity among young people in the last 30 years. There are several famous fashion department stores in Shibuya. Shibuya 109 is a major shopping center near Shibuya Station, particularly famous as the origin of the kogal subculture. Called “Ichi-Maru-kyū,” which translates as 1–0–9 in Japanese, the name is actually a pun on that of the corporation that owns it — Tokyu (which sounds like 10–9 in Japanese). The contemporary fashion scene in Shibuya extends northward from Shibuya Station to Harajuku, where youth culture reigns; Omotesandō, the zelkova tree- and fashion brand-lined street; and Sendagaya, Tokyo’s apparel design district.&lt;br /&gt;
&lt;br /&gt;
During the late 1990s, Shibuya also became known as the center of the IT industry in Japan. It was often called “Bit Valley” in English, a pun on “Bitter Valley,” the literal translation of “Shibuya.”&lt;br /&gt;
&lt;br /&gt;
Shibuya is famous for its scramble crossing. It is located in front of the Shibuya Station Hachikō exit and stops vehicles in all directions to allow pedestrians to inundate the entire intersection. Three large TV screens mounted on nearby buildings overlook the crossing. The Starbucks store overlooking the crossing is also one of the busiest in the world.&lt;/i&gt;&lt;br /&gt;
&lt;br /&gt;
