&lt;p&gt;Day 55 - February 24, 2010&lt;br /&gt;
&lt;b&gt;Boy Behind The Lens Series&lt;/b&gt; - Day 9&lt;br /&gt;
&lt;br /&gt;
I don't drink but I'm the drinks kind of person. &lt;br /&gt;
&lt;br /&gt;
Cherry Coke, Seven Up, Tropicana Pink Lemonade, Ribena, iced tea, ginger ale, apple juice, OJ, iced lattes...I love them all, and like them with plenty of ice.&lt;br /&gt;
&lt;br /&gt;
And for someone who doesn't eat his meals regularly, and usually skips breakfast (and sometimes lunch) beverages are an important part of my diet, a staple of every day.&lt;br /&gt;
&lt;br /&gt;
My favorite drink of all time has got to be F&amp;amp;N Ice Cream Soda (Schweppes also makes one that comes real close). I like Coke after a fatty meal; have an iced venti caramel machiato from Starbucks almost every day; and have lots of water with me regularly to wash all that sugar down.&lt;br /&gt;
