&lt;p&gt;Day 73 - March 14, 2010&lt;br /&gt;
&lt;br /&gt;
Went out earlier for a late night coffee in hopes that I'd find a photo for the day. Found an open Starbucks along 6750 in Makati but by the time we had parked, it had already closed. &lt;br /&gt;
&lt;br /&gt;
Dejected, we walked back to the parking area and that's when I noticed the slots were numbered. We had just walked past #52 so knew that #73 had to be close by. Spent a good five minutes searching till we found it at the far corner, on the same floor of the parking building.&lt;br /&gt;
&lt;br /&gt;
To everyone who started a Project 365 on January 1st of this year I know we have a long way to go, but keep shooting, don't give up, and make sure you have a great time doing it!&lt;/p&gt;

