&lt;p&gt;2/365 - June 3rd 2010&lt;br /&gt;
&lt;br /&gt;
Day 2&lt;br /&gt;
&lt;br /&gt;
Today was pretty uneventful. I was supposed to go see The Dangerous Summer but it just didn’t happen, mainly because of the flat tire. Mom stayed home from work because she is still sick as a dog. I did a bunch of stuff for her during the day. Brian came home at the usual time at 3:30. Took a nap at 4:30 till dad got home with pizza at 5. He got hot and readys, which is usually okay but they got a bunch of stuff on it like olives, onions, green peppers, and mushrooms. I really hate when he does that crap. He knows I won’t eat it. “Oh, well I figured you wouldn’t be home. But you have a flat tire so you really can’t leave anyways so it doesn’t matter.” I don’t understand him sometimes. I then got yelled at about the flat tire. “You are going to fix that… its your fault so you have to put air in and check the other ones. This is your responsibility… BLAH BLAH BLAH.” Mom and dad went to cvs and meijers for stuff, I babysat. They came home with a bunch of groceries… This starbucks ice cream was one of the things they brought home. Futurama and ice cream were the highlights of my night. Went to bed at 11.&lt;/p&gt;

