&lt;p&gt;&lt;a href="http://www.flickr.com/photos/me_ram/4839301490/" title="'40 Dodge"&gt;&lt;img src="http://farm5.static.flickr.com/4125/4839301490_1dd12ee71d_m.jpg" width="240" height="160" alt="'40 Dodge" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;&lt;br /&gt;
&lt;br /&gt;
&lt;b&gt;Trivia about Dodge:&lt;/b&gt;&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
Did you know that Dodge was actually founded as the Dodge Brother’s company in 1900 by Horace and John Dodge? The brand was sold to Chrysler Corporation in 1928, passed through the short-lived DaimlerChrysler merger of 1998-2007 as part of the Chrysler Group, was a part of Chrysler LLC owned by Cerberus Capital Management, a private equity investment firm, and is now a part of the Chrysler Group LLC which has an alliance with Fiat. Fiat has plans to evolve many Dodge, Chrysler, and Jeep existing platforms and products into Fiat-Chrysler co-developed vehicles.&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
The Dodge line, along with most of the corporation’s output, was restyled in the so-called “Wind Stream” look for 1935. This was a mild form of streamlining. It might be common place these days, it was back then when they realized that any vehicle that incorporates a shape that is streamlined produces less resistance to air. &lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
Another major restyle arrived for the 25th anniversary 1939 models, which Dodge dubbed the Luxury Liner series. These were once again completely redesigned with new bodies for 1940. But what is interesting is that, I went around the car and didn’t actually find a model name on it. Maybe it was not a practice then to etch model names in the car. Or maybe they had only one “model”. However, I did find that they had different variants of the same car though. There had a 6 cylinder and a 8 cylinder. And a coupe and a sedan as well. Hmm, is this the root of all vista-esqueness? :D&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;b&gt;About the shot:&lt;/b&gt;&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
It is actually a 1940 Dodge. How do I know that? It is what the plates read. :) Cool, ain’t it? I envy those guys who own vintage cars. So much history goes into it and their designs are beautiful.&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
After getting the previous sunrise shot at the White River state park, I headed towards the Monument circle. Actually, to Starbucks for getting the daily dosage of caffeine. &lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
So this old little guy was parked right outside Starbucks. Ravi and I sat outside the store and admired it for a good half an hour before we decided to get a few pictures. So I put my wide angle 10-22mm on and headed to make a few crazy looking shots. Before I could settle down to make a few, the owner walked by to pull it over. My bad. &lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
Not wanting to disturb him, I backed off and quickly put my camera into Shutter speed priority and 1/20th of a second and fired off a Panning shots when he started driving.&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
Processed in Lightroom to get the Vintage look. I think that it goes in with the subject, what do you think?&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;b&gt;Exposure Information:&lt;/b&gt;&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;br /&gt;
&lt;i&gt;Shutter Speed priority Mode, 1/20th of a sec, ISO 100, EV –1 Stops.&lt;/i&gt;&lt;/p&gt;

