&lt;p&gt;&lt;a href="http://www.flickr.com/photos/cyclist451/4947076122/" title="The Original Peet's Coffee"&gt;&lt;img src="http://farm5.static.flickr.com/4109/4947076122_ac732dd8da_m.jpg" width="240" height="180" alt="The Original Peet's Coffee" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Going back through some older photos.  This is from a Thanksgiving trip in 2008.  We went into Berkeley for lunch (sister-in-law lives in Lafayette) and stopped at Peet's  on the way home.  This is a really cool place.  The following is from the infamous Wikipedia.  As you will note, there is a connection between Peet's and Starbucks, but Peet's coffee is soooo much better.&lt;br /&gt;
&lt;br /&gt;
Alfred Peet started Peet's Coffee &amp;amp; Tea as a single store in 1966 in Berkeley, California. Peet's original outlet is still located on the corner of Walnut and Vine (2124 Vine Street) in Berkeley, close to the University of California  (although it has been renovated to match the look of the newer Peet's outlets elsewhere). Peet grew up in the coffee business while living in the Netherlands as a child. Moving to San Francisco, California, when he was 35, he began roasting coffee as he knew it. Peet's now roasts at a small plant in nearby Alameda. Alfred Peet died of cancer on August 29, 2007, at the age of 87 in his home in Ashland, Oregon.&lt;br /&gt;
&lt;br /&gt;
Peet's was the original inspiration for now-rival Starbucks. The three founders of Starbucks knew Alfred Peet personally, founded Starbucks in Seattle, Washington, and bought the coffee beans for Starbucks directly from Peet's during their first year of business in 1971. Peet sold his business in 1979 but stayed on as a coffee buyer until 1983. In 1984 Jerry Baldwin, one of the original founders of Starbucks and Alfred Peet's former partner, and co-owner Jim Reynolds, the roastmaster, with a group of investors bought Peet's' four Bay Area locations. In 1987, Baldwin and Peet's owners sold the Starbucks chain to focus on Peet's, and Baldwin and Howard Schultz, Starbucks' new owner, entered into a no-compete agreement in the Bay Area.&lt;/p&gt;

