&lt;p&gt;the nisqually earthquake was so severe that the concrete building where Starbucks HQ is located was crazed with cracks &amp;amp; fissures, like a piece of old pottery.  Though apparently no serious structural damage occurred and no serious injuries either, the situation looked very bad, even a bit scary. So rather than simply patch all these cracks with filler, the building was shrouded with what looks like gauze in this image, but was a heavier, water resistant material than this, and masons began working day &amp;amp; night for months to cover the outside surface of the building completely with bricks, which is how it looks today.   Notice there was no siren on top at this point.  The mermaid came later.  (this image and account posted for everyone, but especially for twitter's @SBUXmel)&lt;/p&gt;

